import React from 'react';
import styles from './Construction3.module.css';

const Construction3 = () => {
    const flashcards = [
        { imgSrc: 'picture1.jpg' },
        { imgSrc: 'picture2.jpg' },
        { imgSrc: 'picture3.jpg' },
        { imgSrc: 'picture4.jpg' },
        { imgSrc: 'picture5.jpg' },
        { imgSrc: 'picture6.jpg' }
    ];

    return (
        <div className={styles.container}>
            <h1>Inspiration for Home Interior Designs</h1>
            <p>Give your home a new look with these interior design ideas curated for you.</p>
            <div className={styles.gallery}>
                {flashcards.map((card, index) => (
                    <img key={index} src={card.imgSrc} alt={`Interior design ${index + 1}`} className={index % 3 === 0 ? styles.large : styles.small} />
                ))}
            </div>
        </div>
    );
};

export default Construction3;
